import React, { useState, useEffect } from 'react';
import axios from 'axios';

const OpenComplaints = () => {
  const [complaints, setComplaints] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/complaints/open').then((response) => {
      setComplaints(response.data.complaints); // complaints verisini doğru şekilde alıyoruz
    });
  }, []);

  return (
    <div>
      <h2>Açık Arızalar</h2>
      <table>
        <thead>
          <tr>
            <th>Arıza No</th>
            <th>Başlık</th>
            <th>Kaydı Oluşturan Kullanıcı</th>
            <th>Statü</th>
            <th>Detayları Gör</th>
          </tr>
        </thead>
        <tbody>
          {complaints.map((complaint) => (
            <tr key={complaint[0]}> {/* Burada complaint[0] kullanarak "Arıza No" değerine erişiyoruz */}
              <td>{complaint[0]}</td>
              <td>{complaint[2]}</td> {/* "Başlık" değeri */}
              <td>{complaint[1]}</td> {/* "Kullanıcı ID" değeri */}
              <td>{complaint[5]}</td> {/* "Statü" değeri */}
              <td>{/* Detayları gör butonu ve modal açmak için işlemler */}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default OpenComplaints;
